data_original = """"""

data_types = {d for d in data_original.lower()}

print(data_types)

for d in data_types:
    data = data_original.replace(d, '')
    data = data.replace(d.upper(), '')

    running = True

    while running:
        running = False
        # print(data)
        for i in range(len(data) - 1):
            chem_1 = data[i]
            chem_2 = data[i + 1]
            if ord(chem_1) == ord(chem_2) + 32 or ord(chem_1) + 32 == ord(chem_2):
                data = data[:i] + data[i + 2:]
                running = True
                break

    print(d, len(data))
